import React, { useState } from 'react';
import "./Login.scss";
import logoimg from "../../Assets/Engame_logo.png";

function LoginPage() {

  const [errorMsg, setErrorMsg] = useState("");

  return (
    <div className='login_box'>
      <div className='lb_imgbox'>
        <img src={logoimg}/>
      </div>
      <div className='lb_body'>
        <div className='lb_error_msg'>{errorMsg}</div>
        <input className='lb_inputclass' type="text" placeholder='Username'/>
        <input className='lb_inputclass' type="text" placeholder='Password'/>
        <button className='login_btn' onClick={() => setErrorMsg("Invalid Credentials")}>Login</button>
      </div>
    </div>
  )
}

export default LoginPage
